import classnames from "classnames";

type ButtonProps = {
  height: string;
  width: string;
  color: string;
  buttonText: string;
  textColor: string;
  hoverColor: string;
 }

function Button({ height, width, color, buttonText, textColor, hoverColor }: ButtonProps) {
  const classStr = classnames(
    "flex items-center justify-center text-border rounded-lg mx-4 p-4",
    color,
    height,
    width,
    textColor,
    hoverColor
  );

  return (
    <button className={classStr}>  
          {buttonText}   
    </button>
  )
}

export default Button
